import React from "react";
import { Box, AppBar, ThemeProvider, Typography, createTheme, Fab, Grid } from "@mui/material";
import AddIcon from "@mui/icons-material/Add";

// import { pageTheme } from "./assets/PageTheme";

import CssBaseline from '@mui/material/CssBaseline';

const darkTheme = createTheme({
  palette: {
    mode: 'dark',
  },
});

function App() {
  return (
    <ThemeProvider theme={darkTheme}>
      <CssBaseline />
      <Box>
        <AppBar sx={{ p: 2 }}>
          <Grid container>
            <Grid xs>
              <Typography variant="h4" component="div" sx={{ p: 2 }}>
                Audio Player for Streamed Content
              </Typography>
            </Grid>
            <Grid>
              <Fab color="primary" aria-label="add" sx={{ position: "right" }}>
                <AddIcon />
              </Fab> 
            </Grid> 
          </Grid>        
        </AppBar>
      </Box>
    </ThemeProvider>
  );
}

export default App;
